import React from 'react';
import {Dialog, DialogTitle, DialogContent, Typography, Grid, Paper, Button} from '@material-ui/core';

import SMKeyBoard from "./SMKeyBoard";

export default class SMDialogGamePlay extends React.Component {
    render() {
        const dialogStyle = {
            backgroundColor: "black",
        };
        const titleStyle = {
            fontFamily: "Grinched",
            color: "green",
        };

        return (
        <Dialog onClose={() => this.props.onClick()} fullScreen={true} open={this.props.open}>
            <DialogTitle style={{backgroundColor: '#99ccff'}}>
                <Typography component={'div'} variant="h4" style={titleStyle}>SUPERMATH</Typography>
            </DialogTitle>

            <DialogContent dividers>
                <Grid container direction="row" justify="center" alignItems="flex-start" style={{ backgroundColor: 'orange' }}>
                    <Grid item >
                        <Grid container direction="column" justify="space-around" alignItems="flex-end">
                            <Grid item xs={12}>2</Grid>
                            <Grid item xs={12}>+ 2</Grid>
                        </Grid>
                    </Grid>

                    <Grid item>
                        <SMKeyBoard />
                    </Grid>
                </Grid>
            </DialogContent>

            <DialogContent dividers>
                QQQQQQQQQQQQQQQQ
            </DialogContent>

        </Dialog>
        );
    }
}
